import React from "react";



const Home = () => {
    return (
        <div>
        <div className="Home">
          <h1 className="welcome">Welcome to Craft Cloud!</h1>

          <img src={Lotsyarn} alt="a crafted cloud" />
          <h2>
            A place to organize your yarn hoard for maximum crafting enjoyment!
          </h2>
        </div>
      </div>
    );
  };

  export default Home;
